/*
 * Jeremy's Unit Test Framework-Bootstrap library.
 *
 * Library pieced together as a generalized version of the YUI 3 test
 * library.
 *
 * The generlized functions and entry points are designed to meet 80%
 * of my needs when testing. This is not, and will never be designed
 * to replace YUI Test, QUnit, or any other excellent library.
 *
 * It will allow me, should requirements change, to relatively painlessly swap
 * out the core of my test harness and replace it with another library.
 */
function initializeFramework() {
    // We are using the YUI 3 framework, but basically abstract it out
    YUI({
        logInclude: { TestRunner: 1}
    }).use('test', readyTestEnvironment);
}

function readyTestEnvironment(testobj){
    // Set-up and generalization

    // The "testobj" parameter, in our set-up, is the local-global
    // Y object, initialized for all of our unit test needs.

    // To automate through the Selenium driver, we need a globally
    // available window.Y object. The selenium driver collects test
    // results from this and only this object.
    window.Y = testobj;

    // Make the following functions and classes available through
    // a simple test object.
    var ut = {};
    // The suite class
    ut.TestSuite = testobj.Test.Suite;
    // Test Case class
    ut.TestCase = testobj.Test.Case;
    // Simple assert
    ut.assert = testobj.assert;
    // A bootstrap for our tests
    // We use a paradigm:
    // one test suite per file
    ut.runTests = function(suite) {
        Y.Test.Runner.add(suite);
        Y.Test.Runner.run();
    };

    // We pass the following arguments
    // Our generalized test object,
    // Pass a local reference to our global test framework.
    //   Allows for slightly cleaner code (hopefully).
    setupTests(ut, window.Y)
}
